def debug_message(message, color=67):
    """Send debug message to game client"""
    if not DEBUG_MODE:
        return
    try:
        if message:
            Misc.SendMessage(f"[ASCII] {message}", color)
        else:
            Misc.SendMessage("", color)
    except Exception:
        if message:
            print(f"[ASCII] {message}")
        else:
            print("")

def get_mobiles_in_range(radius):
    """Get all mobiles within radius of player"""
    try:
        mobile_filter = Mobiles.Filter()
        mobile_filter.Enabled = True
        mobile_filter.RangeMax = radius
        mobile_filter.CheckIgnoreObject = False
        
        mobiles = Mobiles.ApplyFilter(mobile_filter)
        return mobiles if mobiles else []
    except Exception as e:
        debug_message(f"Error getting mobiles: {e}", 33)
        return []

def get_statics_at_position(x, y, map_id):
    """Get all static tiles at a position"""
    try:
        tiles = Statics.GetStaticsTileInfo(x, y, map_id)
        return tiles if tiles else []
    except Exception as e:
        return []

def get_items_in_range(radius):
    """Get all items in range around player"""
    try:
        # Use Items.Filter to find items on ground - simplified approach
        item_filter = Items.Filter()
        item_filter.OnGround = 1  # Only items on ground
        item_filter.RangeMax = radius
        
        found_items = Items.ApplyFilter(item_filter)
        
        # Return the list directly (ApplyFilter handles the range filtering)
        return found_items if found_items else []
    except Exception as e:
        debug_message(f"Error getting items: {e}", 33)
        return []

def get_land_at_position(x, y, map_id):
    """Get land tile at a position"""
    try:
        land_info = Statics.GetStaticsLandInfo(x, y, map_id)
        return land_info
    except Exception as e:
        return None

def get_mobile_char(mobile):
    """Get ASCII character and color for a mobile"""
    # Check if it's the player
    if mobile.Serial == Player.Serial:
        return ("A", 88)  # Cyan 'A' for Avatar
    
    # Check body type
    body_id = mobile.Body
    if body_id in MOBILE_ASCII:
        return MOBILE_ASCII[body_id]
    
    # Default based on notoriety
    notoriety = mobile.Notoriety
    if notoriety == 1:  # Innocent (blue)
        return ("N", 88)
    elif notoriety == 2:  # Friend (green)
        return ("F", 68)
    elif notoriety == 3:  # Gray/Attackable
        return ("G", 901)
    elif notoriety == 4:  # Criminal (gray)
        return ("C", 901)
    elif notoriety == 5:  # Enemy (orange)
        return ("E", 53)
    elif notoriety == 6:  # Murderer (red)
        return ("M", 33)
    else:
        # Unknown notoriety - use default
        return (DEFAULT_MOBILE_CHAR, DEFAULT_MOBILE_HUE)

def get_static_ascii(static_id):
    """Get ASCII character and color for a static item
    
    Priority order:
    1. STATIC_ASCII_OVERRIDE - specific overrides with custom char + hue
    2. STATIC_ITEM_HUES - generated hue mappings (uses default char)
    3. Default fallback
    """
    # Priority 1: Check override dictionary (custom char + hue)
    if static_id in STATIC_ASCII_OVERRIDE:
        return STATIC_ASCII_OVERRIDE[static_id]
    
    # Priority 2: Check STATIC_ITEM_HUES (default char + matched hue)
    if static_id in STATIC_ITEM_HUES:
        hue_id = STATIC_ITEM_HUES[static_id]
        return (DEFAULT_STATIC_CHAR, hue_id)
    
    # Priority 3: Return default for unknown statics
    return (DEFAULT_STATIC_CHAR, DEFAULT_STATIC_HUE)

