# ASCII DISPLAY RENDERER

class ASCIIRenderer:
    def __init__(self, scanner):
        self.scanner = scanner
        
    def render_to_gump(self):
        """Render the ASCII display to a gump"""
        gump = Gumps.CreateGump()
        
        # Background - black with hue 3000
        Gumps.AddBackground(gump, 0, 0, GUMP_WIDTH, GUMP_HEIGHT, 9200)
        Gumps.AddImageTiled(gump, 0, 0, GUMP_WIDTH, GUMP_HEIGHT, 2624)
        Gumps.AddAlphaRegion(gump, 0, 0, GUMP_WIDTH, GUMP_HEIGHT)
        
        # Title and player position (controlled by SHOW_TITLE)
        if SHOW_TITLE:
            Gumps.AddLabel(gump, 10, 10, 88, "ASCII World Display")
            Gumps.AddLabel(gump, 10, 30, 67, f"Player: ({self.scanner.player_x}, {self.scanner.player_y}, {self.scanner.player_z})")
        
        # Render area
        render_x = 400  # Center horizontally
        render_y = 300  # Center vertically
        
        # Create isometric grid display
        # In UO: North decreases Y, East increases X
        # Isometric view: screen_x = (world_x - world_y), screen_y = (world_x + world_y) / 2
        radius = DISPLAY_RADIUS
        
        # Render in world coordinate order to match UO perspective
        for dy in range(-radius, radius + 1):
            for dx in range(-radius, radius + 1):
                world_x = self.scanner.player_x + dx
                world_y = self.scanner.player_y + dy
                
                # Convert world coords to isometric screen position
                # This creates the diamond/isometric view where North-East is "up"
                iso_x = (dx - dy) * (CHAR_WIDTH // 2)
                iso_y = (dx + dy) * (CHAR_HEIGHT // 4)
                
                current_x = render_x + iso_x
                current_y = render_y + iso_y
                
                # Check for mobile at this position (including player)
                mobile_here = None
                for mobile in self.scanner.mobiles_data:
                    if mobile["x"] == world_x and mobile["y"] == world_y:
                        mobile_here = mobile
                        break
                
                # Special check for player at exact position
                if world_x == self.scanner.player_x and world_y == self.scanner.player_y:
                    # Always show player with bright cyan '@' symbol
                    Gumps.AddLabel(gump, current_x, current_y, 88, "@")
                # Display priority: Mobile > Item > Static > Land
                elif mobile_here:
                    # Display mobile
                    Gumps.AddLabel(gump, current_x, current_y, mobile_here["color"], mobile_here["char"])
                elif (world_x, world_y) in self.scanner.items_data:
                    # Display item (world object)
                    items = self.scanner.items_data[(world_x, world_y)]
                    if items:
                        item = items[0]  # Take first item if multiple at same location
                        Gumps.AddLabel(gump, current_x, current_y, item["color"], item["char"])
                elif (world_x, world_y) in self.scanner.statics_data:
                    # Display static
                    statics = self.scanner.statics_data[(world_x, world_y)]
                    if statics:
                        static = statics[0]  # Take first static
                        Gumps.AddLabel(gump, current_x, current_y, static["color"], static["char"])
                elif (world_x, world_y) in self.scanner.land_data:
                    # Display land
                    land = self.scanner.land_data[(world_x, world_y)]
                    land_id = land["id"]
                    
                    # Get UO hue from LAND_TILE_HUES
                    uo_hue = get_land_uo_hue(land_id)
                    
                    # Use UO hue from LAND_TILE_HUES (includes default fallback)
                    Gumps.AddLabel(gump, current_x, current_y, uo_hue, land["char"])
                else:
                    # Empty space
                    Gumps.AddLabel(gump, current_x, current_y, 1967, ".")
        
        # Legend (controlled by SHOW_LEGEND)
        if SHOW_LEGEND:
            legend_y = GUMP_HEIGHT - 100
            Gumps.AddLabel(gump, 10, legend_y, 900, "Legend:")
            Gumps.AddLabel(gump, 10, legend_y + 15, 88, "@")
            Gumps.AddLabel(gump, 25, legend_y + 15, 900, "= Player (You)")
            Gumps.AddLabel(gump, 10, legend_y + 30, 88, "@")
            Gumps.AddLabel(gump, 25, legend_y + 30, 900, "= Other Players")
            Gumps.AddLabel(gump, 10, legend_y + 45, 38, "R")
            Gumps.AddLabel(gump, 25, legend_y + 45, 900, "= Creatures")
            Gumps.AddLabel(gump, 10, legend_y + 60, 68, "T")
            Gumps.AddLabel(gump, 25, legend_y + 60, 900, "= Trees")
        
        # Close button (controlled by SHOW_CLOSE_BUTTON)
        # Button ID 1 = close and stop script
        if SHOW_CLOSE_BUTTON:
            Gumps.AddButton(gump, GUMP_WIDTH - 50, 10, 4017, 4018, 1, 0, 1)
        
        return gump

